import React from "react";
import { FirstName } from "./App";
const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => {
          return <h1>{fname}</h1>;
        }}
      </FirstName.Consumer>
      <h1>Hello World</h1>
    </>
  );
};
export default CompC;

// Consumer always expect a function from provider
